    // const { title, capacity,type, images, price, city, state, zip
    // } = houseInfo;

    let price = houses.price;
    let imgSrc = houses.imgSrc;
    let id, title, statusType, beds, baths, city, state, zip, location;

    if (!!houses.zpid) {
        // with zpid
        id = houses.zpid;
        title = houses.hdpData.homeInfo.streetAddress;
        statusType = houses.statusText;
        beds = houses.beds;
        baths = houses.baths;
        city = houses.hdpData.homeInfo.city;
        state = houses.hdpData.homeInfo.state;
        zip = houses.hdpData.homeInfo.zipcode;
        location = city + " • " + state + " • " + zip;
    } else {
        // with buildingId
        id = houses.buildingId;
        title = houses.statusText;
        statusType = houses.statusType;
        beds = houses.minBeds;
        baths = houses.minBaths;
        location = " ";
    }

    return (

        <div className="listing-card-container">
            {/* Listing Card Image */}
            <div className="listing-card-image-container">
                <Link to={`/housedetails/${id}`}>
                    <img src={imgSrc || defaultImg} alt="house listing"></img>
                </Link>
            </div>

            {/* Listing Card Content */}
            <div className="listing-card-content-container">
                <Link to={`/housedetails/${id}`} className="house-card-title"> {title} </Link>
                <div className="house-card-detail">
                    {/* <p>Type: {`${type}`}</p>
                    <p>Capacity: {capacity}</p>
                    <p>{`${city} • ${state} • ${zip}`}</p>
                    <p><span className="price-tag">{`$${price}`}</span> / month </p> */}
