                    <p>Status: {statusType}</p>
                    <p>beds: {beds}</p>
                    <p>baths: {baths}</p>
                    <p>{location}</p>
                    <button onClick={()=> addToTable(houses)}>Add to House-Table</button>
                </div>

            </div>

        </div>
    )
}
